package main

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestMaximumToysOrderedPrices(t *testing.T) {
	prices := []int32{1, 2, 3}
	k := int32(3)

	returned := maximumToys(prices, k)
	expected := int32(2)

	assert.Equal(t, expected, returned)
}

func TestMaximumToysUnorderedPrices(t *testing.T) {
	prices := []int32{3, 1, 2}
	k := int32(3)

	returned := maximumToys(prices, k)
	expected := int32(2)

	assert.Equal(t, expected, returned)
}

func TestMaximumToysNoMoney(t *testing.T) {
	prices := []int32{3, 10, 2}
	k := int32(1)

	returned := maximumToys(prices, k)
	expected := int32(0)

	assert.Equal(t, expected, returned)
}

